<template>
  <main class="container or-flex">
    <div class="slider or-flex">
      <div class="or-flex">
        <transition name="fadeIn">
          <img
            v-show="currentSlide"
            :src="currentSlide[0].img"
            :alt="currentSlide[0].desc"
            class="img"
          >
        </transition>
      </div>
      <div class="buttons-pag">
        <button class="buttons-pag_button" @click="switchSlide((slideNow-1<0)?slider.length-1:slideNow-1)">
          <font-awesome-icon :icon="['fas', 'angle-left']" size="lg" />
        </button>
        <button class="buttons-pag_button" @click="switchSlide((slideNow+1>slider.length-1)?0:slideNow+1)">
          <font-awesome-icon :icon="['fas', 'angle-right']" size="lg" />
        </button>
      </div>
      <div class="slider_pagination">
        <ul>
          <li v-for="(dot,index) in slider" :key="index" :class="{selected: index===slideNow}" @click="switchSlide(index)" />
        </ul>
      </div>
    </div>
    <div class="banners">
      <div v-for="(banner,index) in banners" :key="index" class="banners_banner or-flex">
        <div class="banners_banner-header absolut or-flex">
          <span class="banners_banner-text">{{ banner.text }}</span>
          <NuxtLink :to="banner.href" class="banners_banner-link">
            <span>Shop now</span>
          </NuxtLink>
        </div>
        <img :src="banner.img" :alt="banner.text" class="img">
      </div>
    </div>
  </main>
</template>

<script>
export default {
  name: 'Main',
  data () {
    return {
      slideNow: 0,
      slider: [{
        img: 'data:image/jpeg;base64,',
        href: '/todo',
        desc: 'White Ceramic'
      }, {
        img: 'data:image/jpeg;base64,\n',
        href: '/todo',
        desc: 'Ceramic Planters'
      }],
      banners: [
        {
          img: 'data:image/jpeg;base64,',
          text: 'Dinner Wear Items',
          href: '/todo'
        }, {
          img: 'data:image/jpeg;base64,',
          text: 'New Serving Plate',
          href: '/todo'
        }
      ]
    }
  },
  computed: {
    currentSlide () {
      return this.slider.filter((el, i) => i === this.slideNow)
    }
  },
  methods: {
    switchSlide (slide) {
      this.slideNow = (slide === this.slideNow) ? this.slideNow : slide
    }
  }

}
</script>

